import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import { useRouter } from 'next/router';
import Link from 'next/link';

function Header() {
    const navLinks = [
        {
            text: "ğ–•ğ–”ğ–—ğ–™ğ–‹ğ–”ğ–‘ğ–ğ–”",
            link: "/"
        },
        {
            text: "ğ–’ğ–ğ–˜ğ–ˆ",
            link: "/misc"
        },
        {
            text: "ğ–‘ğ–ğ–‹ğ–Š",
            link: "/blog"
        },
        {
            text: "ğ–†ğ–‡ğ–”ğ–šğ–™",
            link: "/about"
        },
        {
            text: "ğ–ˆğ–”ğ–“ğ–™ğ–†ğ–ˆğ–™",
            link: "/contact"
        }
    ]
    const router = useRouter();
    return <div>
        <h1 className="text-center font-weight-bold mt-5 v-">ğ–—ğ–Šğ–‘ğ–‘ğ–ğ–”ğ–˜</h1>
        <Navbar expand="md" className="navbar-light bg-transparent mt-5">
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav defaultActiveKey="/" activekey={router.pathname} className="justify-content-end">
                    {navLinks.map(navItem => {
                        return <Nav.Item key={navItem.text}>
                            <Nav.Link eventKey={navItem.link}><a>{navItem.text}</a></Nav.Link>
                        </Nav.Item>
                    })}
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    </div >
}

export default Header;
